import React from "react";
import Navbar from "../components/Navbar";

const Contact = () => (
  <div>
    <div className="flex justify-center items-center h-screen bg-[#202020]">
      <div className="bg-[#303030] rounded-3xl p-12 shadow-xl w-[500px]">
        <h1 className="inter-bold text-[36px] text-[#FF3131] mb-6 text-center">Contact</h1>
        <p className="inter text-[#D2D2D2] text-[18px] mb-4">
          You can reach us at <a href="mailto:info@quakify.com" className="text-[#FF3131] underline">info@quakify.com</a>
        </p>
        <p className="inter-light text-[#B0B0B0] text-[16px]">
          For feedback or support, please use the email above.
        </p>
      </div>
    </div>
  </div>
);

export default Contact;
